import React, { useEffect, useState } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import axios from 'axios';
import { FaChalkboardTeacher } from 'react-icons/fa';

const CoursePages = () => {
  const { universityId } = useParams();
  const [courses, setCourses] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    axios
      .get(`http://localhost:5000/api/courses/university/${universityId}`)
      .then((res) => setCourses(res.data))
      .catch((err) => console.error('Failed to fetch courses:', err));
  }, [universityId]);

  const groupCourses = () => {
    const ug = [];
    const pg = [];

    courses.forEach((course) => {
      const name = course.courseName.toLowerCase();
      if (name.includes('b.') || name.includes('undergraduate')) {
        ug.push(course);
      } else if (name.includes('m.') || name.includes('postgraduate')) {
        pg.push(course);
      } else {
        ug.push(course); // default fallback
      }
    });

    return { ug, pg };
  };

  const { ug, pg } = groupCourses();

  const handleExplore = (type, courseId) => {
    alert(`🔍 You can navigate to ${type} for course ID: ${courseId}`);
    // navigate(`/resources/${type}/${courseId}`);
  };

  const renderCourses = (courseList, categoryLabel) => (
    <div className="mb-12">
      <h2 className="text-3xl font-bold mb-6 text-blue-700 dark:text-blue-300">{categoryLabel}</h2>
      <div className="grid sm:grid-cols-2 md:grid-cols-3 gap-8">
        {courseList.map((course, i) => (
          <div
            key={i}
            className="bg-white dark:bg-gray-800 shadow-md rounded-xl p-6 border border-green-100 dark:border-gray-700"
          >
            <h2 className="text-xl font-semibold text-green-700 dark:text-green-200 mb-2">
              {course.courseName}
            </h2>
            <p className="text-sm text-gray-600 dark:text-gray-400">
              <strong>Semester:</strong> {course.semester}
            </p>
            <p className="text-sm text-gray-600 dark:text-gray-400">
              <strong>Department:</strong> {course.department}
            </p>
            <p className="text-sm text-gray-600 dark:text-gray-400 mb-4">
              <strong>University:</strong> {course.university?.name || 'N/A'}
            </p>

            <div className="flex flex-col gap-2">
              <button
                onClick={() => handleExplore('notes', course._id)}
                className="bg-blue-600 hover:bg-blue-700 text-white px-4 py-2 rounded"
              >
                📘 View Notes
              </button>
              <button
                onClick={() => handleExplore('syllabus', course._id)}
                className="bg-purple-600 hover:bg-purple-700 text-white px-4 py-2 rounded"
              >
                📄 View Syllabus
              </button>
              <button
                onClick={() => handleExplore('papers', course._id)}
                className="bg-green-600 hover:bg-green-700 text-white px-4 py-2 rounded"
              >
                📑 View Question Papers
              </button>
            </div>
          </div>
        ))}
      </div>
    </div>
  );

  return (
    <div className="min-h-screen px-6 py-16 bg-gray-50 dark:bg-gray-900 text-gray-800 dark:text-white">
      <h1 className="text-4xl sm:text-5xl font-extrabold text-center mb-12 text-green-800 dark:text-green-300 flex justify-center items-center gap-3">
        <FaChalkboardTeacher className="text-yellow-400 text-5xl" />
        <span>Courses Offered</span>
      </h1>

      {courses.length === 0 ? (
        <p className="text-center text-gray-500 dark:text-gray-400">
          No courses found for this university.
        </p>
      ) : (
        <>
          {renderCourses(ug, '🎓 Undergraduate Courses')}
          {pg.length > 0 && renderCourses(pg, '🎓 Postgraduate Courses')}
        </>
      )}
    </div>
  );
};

export default CoursePages;
